import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    Followers: [],
    Following: []
}

export const updateFollowDataSlice = createSlice({
    name: "followData",
    initialState,
    reducers: {
       updateFollowData: {}
    }
})

export const { } = updateFollowDataSlice.actions;

export default updateFollowDataSlice.reducer;
